						["custom"] = "function(allstates,e,nilc)\n    if not allstates[1] then\n        allstates[1] = {}\n    end\n    \n    local state = allstates[1]\n    state.show = true\n    state.changed = true\n    \n    local num = \"180653\"\n    local textCut\n    local c = \"|cffffffff\"\n    local a = aura_env\n    \n    -- Return false if no key in bag\n    if a.key(true) then\n        textCut = string.find(a.key(true), num)\n    else\n        state.icon = 525134\n        state.level = \"Key\"\n        state.shortName = \"No\"\n        state.tooltip = \"Get your Keystone by completing any Dungeon\\non Mythic or Mythic Plus Difficulty\"\n        return e == \"BETTER_MYTHIC_PLUS\" and nilc  \n    end\n    \n    local name,_,_,icon = C_ChallengeMode.GetMapUIInfo(string.sub(a.key(true),textCut+7,textCut+9))\n    local level = string.gsub(string.sub(a.key(true),textCut+11,textCut+12),\":\",\"\")\n    local id = string.gsub(string.sub(a.key(true),textCut+6,textCut+9),\":\",\"\")\n    \n    id = tonumber(id)    \n    level = tonumber(level)\n    \n    if level >= 15 then level = 15 end\n    \n    local mod = C_ChallengeMode.GetPowerLevelDamageHealthMod(level)\n    local modFort = {40,15,0,0}\n    local affix = C_MythicPlus.GetCurrentAffixes()\n    if affix then\n        if affix[1].id == 10 then modFort = {0,0,20,30} end\n    end\n    \n    local modifiers = {\n        \"Boss Health +\"..mod+modFort[1]..\"%\",\n        \"Boss Damage +\"..mod+modFort[2]..\"%\",\n        \"Trash Health +\"..mod+modFort[3]..\"%\",\n        \"Trash Damage +\"..mod+modFort[4]..\"%\",\n    }\n    \n    state.icon = icon\n    state.name = name\n    state.shortName = a.mapID[id].shortName\n    state.level = level\n    state.tooltip = c\n    ..\"Your Key:\\n|cffa335ee\"..name..\" +\"..level\n    ..\"\\n \\n\"..c..\"Modifiers:\\n\"..table.concat(modifiers, c..\"\\n\")\n    ..\"\\n \\n\"..c..\"End of Dungeon Loot:\\n\"..a.loot[level]    \n    \n    return e == \"BETTER_MYTHIC_PLUS\" and nilc    \nend\n\n\n",
