					["custom"] = "aura_env.createDumbFrame = function()\n    aura_env.dumbFrame = dumbFrame\n    if not aura_env.dumbFrame then\n        aura_env.dumbFrame = CreateFrame(\"Frame\", \"dumbFrame\");\n    end\n    aura_env.dumbFrame:SetScale(UIParent:GetScale())\n    aura_env.dumbFrame:SetAllPoints();\n    return aura_env.dumbFrame\nend\n\naura_env.createDumbFrame()\n\naura_env.print = function(string)\n    --print(string)\nend\n\nlocal name = UnitName(\"player\");\nlocal classFilename, classId = UnitClassBase(\"player\");\n\nif aura_env.config[\"showRealm\"] then\n    name = name..\"-\"..GetRealmName();\nend\n\nif aura_env.config[\"showTitle\"] then\n    local titleId = GetCurrentTitle();\n    if titleId ~= -1 then\n        local titleName = GetTitleName(titleId);\n        local titleLastChar = string.sub(titleName, -1,-1);\n        local titleFirstChar = string.sub(titleName, 1, 1);\n        if titleLastChar == \" \" then\n            name = titleName..name;\n        else\n            if titleFirstChar == string.upper(titleFirstChar) then\n                name = name..\",\";\n            end\n            name = name..\" \"..titleName;\n        end\n    end\nend\naura_env.name = name;\n\naura_env.colorStr = \"FFFFFFFF\";\nif aura_env.config[\"useClassColor\"] then\n    aura_env.colorStr = RAID_CLASS_COLORS[classFilename].colorStr;\nend\n\naura_env.print(\"AFK Name intit\")",
