			["preferToUpdate"] = false,
			["customText"] = "function()\n    --Check Class\n    --local ClassID = aura_env.ClassID\n    --local SpecID = aura_env.SpecID\n    \n    --Bursting Stuff\n    local stack\n    local duration\n    local Bursting\n    \n    --HP Calcs\n    local Absorbs = UnitGetTotalAbsorbs(\"player\")\n    local Vers = 1 - (GetCombatRatingBonus(31) / 100)\n    local CurrentHealth = UnitHealth(\"player\") + Absorbs\n    local MaxHealth = UnitHealthMax(\"player\") + Absorbs\n    --local PercentHealth = CurrentHealth / MaxHealth * 100\n    \n    --Class Reductions\n    \n    \n    --Reductions\n    local Reduction = Vers\n    \n    --Effektive Health\n    local EBMax = MaxHealth / Reduction\n    local EBCur = CurrentHealth / Reduction\n    local EBPer = EBCur / EBMax * 100\n    \n    --Missing HP\n    local BurstingMs\n    \n    if not aura_env.state then \n        stack = 0\n        Bursting = 0\n        duration = 0\n    else\n        stack = aura_env.state.stacks\n        duration = aura_env.state.expirationTime - GetTime()\n        Bursting = Round(duration * 4 * stack)\n        BurstingMs =  Bursting - EBPer\n    end\n    \n    if Bursting >= EBPer then\n        return \"Missing HP\" .. \" (\" .. BurstingMs .. \"%)\"\n    else\n        return (Bursting) .. \"%\" .. \"\" \n    end\nend",
