			["actions"] = {
				["start"] = {
				},
				["init"] = {
					["custom"] = "aura_env.GetScore = function(level, time, max_time)\n    local star\n    if time <= max_time*0.6 then star = 3\n    elseif time <= max_time*0.8 then star = 2\n    else star = 1\n    end   \n    local DeltaTimePerc = (100-((100*time)/max_time))/100*8.25\n    if star >= 1 and time <= max_time and level >= 11 then\n        aura_env.score = (100+DeltaTimePerc+(star-1)*1.5)*1.1^(level-10)+0.025\n    elseif star  >= 1 and time <= max_time and level <= 10 then\n        aura_env.score = (10*level+DeltaTimePerc+1.6*(star-1))+0.05\n    end\n    aura_env.score = math.floor((aura_env.score * 10^1)+0.5)/(10^1)\n    return aura_env.score\nend\n\naura_env.GetScoreColor = function(score)\n    if (IsAddOnLoaded(\"RaiderIO\")) then\n        local rR, rG, rB = RaiderIO.GetScoreColor(score)\n        aura_env.scoreC = string.format(\"|cff%.2X%.2X%.2X\", rR*255, rG*255, rB*255)\n    else\n        aura_env.scoreC = \"\"\n    end\n    return aura_env.scoreC\nend\naura_env.map = {\n    \n    [375] = {shortName = \"Mists\"},\n    [376] = {shortName = \"NW\"},\n    [377] = {shortName = \"DOS\"},\n    [378] = {shortName = \"HoA\"},\n    [379] = {shortName = \"PF\"},\n    [380] = {shortName = \"SD\"},\n    [381] = {shortName = \"SoA\"},\n    [382] = {shortName = \"ToP\"},\n}",
					["do_custom"] = true,
				},
				["finish"] = {
