			["triggers"] = {
				{
					["trigger"] = {
						["type"] = "custom",
						["subeventSuffix"] = "_CAST_START",
						["custom_hide"] = "custom",
						["subeventPrefix"] = "SPELL",
						["event"] = "Health",
						["unit"] = "player",
						["custom"] = "function(e,nilc)\n    local zone = C_ChallengeMode.GetMapTable()\n    local sum = 0\n    aura_env.name = {}\n    aura_env.name2 = {}\n    aura_env.tex = {}\n    aura_env.mapid = {}\n    aura_env.sum = {}    \n    aura_env.sum2 = {}\n    for i = 1, #zone do\n        local info = C_MythicPlus.GetSeasonBestForMap(zone[i])\n        local _,_,maxtime,texture = C_ChallengeMode.GetMapUIInfo(zone[i])\n        if info ~= nil then\n            local score = aura_env.GetScore(info.level, info.durationSec, maxtime)\n            local sN = aura_env.map[zone[i]].shortName\n            sum = sum + score\n            score = string.format(\"%.1f\",score)\n            tinsert(aura_env.name, score..\"      \")\n            tinsert(aura_env.name2, score..\"      \")\n            tinsert(aura_env.tex, \"|T\"..texture..\":0|t\")\n            tinsert(aura_env.mapid, sN..\"\\n\"..info.level)\n        end\n        \n    end\n    for i, v in ipairs(aura_env.tex) do\n        aura_env.sum[aura_env.name[i]] = v\n    end\n    table.sort(aura_env.name, function(a,b) return b<a end)\n    aura_env.tex = {}\n    for i = 1,#aura_env.name do\n        aura_env.tex[i]=aura_env.sum[aura_env.name[i]]\n    end\n    aura_env.sum = nil\n    for i, v in ipairs(aura_env.mapid) do\n        aura_env.sum2[aura_env.name2[i]] = v\n    end\n    table.sort(aura_env.name2, function(a,b) return b<a end)\n    aura_env.mapid = {}\n    for i = 1,#aura_env.name2 do\n        aura_env.mapid[i]=aura_env.sum2[aura_env.name2[i]]\n    end\n    aura_env.sum2 = nil\n    \n    tinsert(aura_env.name, \"_______\\n\"..aura_env.GetScoreColor(sum)..sum..\"*\")\n    return e == \"BETTER_MYTHIC_PLUS\" and nilc\nend",
