				},
				["init"] = {
					["custom"] = "aura_env.spellID = 347350\naura_env.bursts = {}\naura_env.debuffs = {}\naura_env.sound = false\n\naura_env.say = {\n    \n    [2] = \"2nd JUMP\",\n    [3] = \"3rd JUMP\",\n    [4] = \"4th JUMP\",\n    [5] = \"5th JUMP\",\n    \n    \n}\n\n\n\naura_env.text = {\n    \n    \n    [1] = \"1st: \",\n    [2] = \"2nd: \",\n    [3] = \"3rd: \",\n    \n    [4] = \"4th: \",\n    [5] = \"5th: \",\n    \n    \n}\n\n\n\n",
