						["subeventSuffix"] = "_CAST_START",
						["event"] = "Health",
						["subeventPrefix"] = "SPELL",
						["events"] = "ENCOUNTER_START, ENCOUNTER_END, CLEU:SPELL_AURA_APPLIED, CLEU:SPELL_AURA_REMOVED",
						["check"] = "event",
						["custom_type"] = "status",
						["custom"] = "function(event, timestamp, subevent, hideCaster, sourceGUID, sourceName, sourceFlags, sourceRaidFlags, destGUID, destName, destFlags, destRaidFlags, spellID, spellName, spellSchool, extraSpellId)\n    \n    if subevent == \"SPELL_AURA_APPLIED\" and spellID == aura_env.spellID then\n        table.insert(aura_env.bursts, destName)\n        if UnitIsUnit(\"player\", destName) and aura_env.say[#aura_env.bursts] then\n            SendChatMessage(aura_env.say[#aura_env.bursts], \"SAY\")\n        end\n        return true\n    end\n    \n    \n    if event == \"ENCOUNTER_START\" or event == \"ENCOUNTER_END\" then\n        aura_env.bursts = {}\n        aura_env.sound = false\n        aura_env.debuffs = {}\n        return true\n    end\n    \nend\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n",
