						["custom"] = "function(event, timestamp, subevent, hideCaster, sourceGUID, sourceName, sourceFlags, sourceRaidFlags, destGUID, destName, destFlags, destRaidFlags, spellID, spellName, spellSchool, extraSpellId)\n    if subevent == \"SPELL_AURA_REMOVED\" and spellID == aura_env.spellID then\n        aura_env.untrigger = true\n        for unit in WA_IterateGroupMembers() do\n            if WA_GetUnitDebuff(unit, aura_env.spellID) then\n                aura_env.untrigger = false\n            end\n        end\n        if aura_env.untrigger then\n            aura_env.bursts = {}\n            aura_env.sound = false\n            aura_env.debuffs = {}\n            return true\n        end\n    end\n    \nend",
