					["custom"] = "aura_env.preScanComplete = false\naura_env.usedMarkers = {} -- Table containing pairs of GUID and mark\naura_env.markers = {} -- Populated from User Options\naura_env.playerZone = \"0\"\n\n-- Create a list of targets to scan for pre-placed markers on\naura_env.preScan = { \"player\" }\nfor i = 1,4 do\n    table.insert(aura_env.preScan, \"party\"..i)\nend\nfor i = 1,40 do\n    table.insert(aura_env.preScan, \"nameplate\"..i)\nend\n\n-- Create list of allowed markers\nfor markerID, active in pairs(aura_env.config[\"markers\"]) do\n    if active then\n        table.insert(aura_env.markers, tonumber(markerID))\n    end\nend\ntable.sort(aura_env.markers) -- Sort the list so that markers always go out in deterministic order. Silly LUA.\n\n-- Simple function that returns the first free (unused) marker\naura_env.GetFirstFreeMarker = function()\n    for _, candidate in ipairs(aura_env.markers) do\n        local valid = true\n        \n        for _, p in pairs(aura_env.usedMarkers) do\n            if candidate == p then\n                valid = false\n                break\n            end\n        end\n        \n        if valid then\n            return candidate\n        end\n    end\n    \n    -- No free markers\n    return false\nend\n\n-- Function that marks a given target if it's in the list and a marker is free\naura_env.CheckAndMark = function(target, checkCombat)\n    local uGUID = UnitGUID(target)\n    \n    if checkCombat and not UnitAffectingCombat(target) then\n        return\n    end\n    \n    -- Check for a mark that has already been placed locally.\n    if aura_env.usedMarkers[uGUID] then\n        return\n    end\n    \n    -- In a zone where nothing should be marked\n    if not aura_env.config[aura_env.playerZone] then\n        return\n    end\n    \n    if uGUID then\n        local hasMark = GetRaidTargetIndex(target)\n        local npcId = select(6, strsplit(\"-\", uGUID))\n        \n        -- Another person or addon has marked this target, leave it be\n        if hasMark and not aura_env.usedMarkers[uGUID] then\n            aura_env.usedMarkers[uGUID] = hasMark\n            return\n        end\n        \n        if not hasMark and npcId then\n            if aura_env.config[aura_env.playerZone][npcId] or aura_env.config[\"season\"][npcId] then\n                local mark = aura_env.GetFirstFreeMarker()\n                \n                if mark then\n                    SetRaidTarget(target, mark)\n                    aura_env.usedMarkers[uGUID] = mark\n                end\n            end\n        end\n    end\nend\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n",
