						["unit"] = "player",
						["check"] = "event",
						["custom"] = "function(event, _, subEvent, _, _, _, _, _, destGUID, ...)\n    if event == \"PLAYER_REGEN_ENABLED\" then\n        wipe(aura_env.usedMarkers)\n        aura_env.preScanComplete = false\n        \n    elseif event == \"PLAYER_REGEN_DISABLED\" then\n        -- Create list of pre-placed markers\n        for _,v in ipairs(aura_env.preScan) do\n            local mark = GetRaidTargetIndex(v)\n            if ( mark ) then\n                local newGUID = UnitGUID(v)\n                aura_env.usedMarkers[newGUID] = mark\n            end\n        end\n        \n        aura_env.preScanComplete = true\n        \n    elseif event == \"ZONE_CHANGED_NEW_AREA\" then\n        aura_env.playerZone = tostring(select(8, GetInstanceInfo()))\n        \n    elseif subEvent == \"UNIT_DIED\" then\n        -- Free up usedMarkers from marked targets who died\n        if aura_env.usedMarkers[destGUID] then\n            -- Freeing up the table by setting to nil doesn't seem to work in Blizzards LUA\n            aura_env.usedMarkers[destGUID] = 0    \n        end\n    end\n    \n    return true\nend\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n",
