						["custom"] = "function(event, ...)\n    -- Events that can result in marks being placed\n    \n    -- Don't mark if not leader. We really shouldn't even load the WA, but there's no leader condition.\n    if not UnitIsGroupLeader(\"player\") then\n        return\n    end\n    \n    if event == \"UPDATE_MOUSEOVER_UNIT\" then\n        -- Mark eligible targets under the mouse when shift is held, no matter combat status\n        if aura_env.config[\"misc\"][\"promisc\"] or IsShiftKeyDown() then\n            aura_env.CheckAndMark(\"mouseover\", false)\n        end\n        \n    elseif event == \"UNIT_AURA\" then\n        -- An event that fires reasonably often, but not as often as every frame\n        if aura_env.preScanComplete then\n            -- Loop through the visible nameplates for something to mark\n            for i = 1,40 do\n                local target = \"nameplate\"..i\n                aura_env.CheckAndMark(target, true)\n            end\n        end\n    end\n    return true\nend\n\n\n",
