						["custom"] = "function(states, event, timestamp, subevent, hideCaster, sourceGUID, sourceName, sourceFlags, sourceRaidFlags, destGUID, destName, destFlags, destRaidFlags, spellID, ...)\n    \n    if subevent == \"SPELL_AURA_APPLIED\" then\n        if aura_env.shields[spellID] then\n            states[\"\"] = {\n                progressType = \"static\",\n                value = 0,\n                total = 10, \n                show = true,\n                changed = true,\n                additionalProgress = {\n                    {\n                        direction = \"forward\",\n                        width = 0,\n                        offset = 0,\n                        \n                    },\n                },\n            }\n            return true\n        else\n            local v = (spellID == aura_env.orbd1 and 1) or (spellID == aura_env.orbd2 and 3) or 0\n            if v > 0 and states[\"\"] then\n                states[\"\"].additionalProgress[1].width = states[\"\"].additionalProgress[1].width+v\n                return true\n            end\n        end\n    elseif subevent == \"SPELL_AURA_REMOVED\" then\n        if spellID == aura_env.orbd1 or spellID == aura_env.orbd2 then\n            local v = 0\n            for unit in WA_IterateGroupMembers() do\n                local a = (WA_GetUnitAura(unit, aura_env.orbd1, aura_env.debug) and 1) or (WA_GetUnitAura(unit, aura_env.orbd2, aura_env.debug) and 3) or 0\n                v = v+a\n            end\n            if states[\"\"] then\n                states[\"\"].additionalProgress[1].width = v\n                states[\"\"].changed = true\n                return true\n            end\n            \n        elseif aura_env.shields[spellID] then\n            aura_env.debuffed = {}\n            if states[\"\"] then\n                states[\"\"].show = false\n                states[\"\"].changed = true\n                return true\n            end\n            \n        end\n    elseif subevent == \"SPELL_ENERGIZE\" then\n        local v = (spellID == aura_env.orb1 and 1) or (spellID == aura_env.orb2 and 3) or 0\n        if v > 0 and states[\"\"] then\n            states[\"\"].value = states[\"\"].value+v\n            states[\"\"].changed = true\n            return true\n        end\n    end\n    \nend\n\n\n\n\n\n\n--[[\n\nlocal d = (v == 1 and aura_env.orbd1) or (v == 3 and aura_env.orbd2)\nfor a, b in pairs(aura_env.debuffed) do\n    if b and b[2] == v and not WA_GetUnitAura(a, d, aura_env.debug) then\n        states[\"\"].additionalProgress[1].width = states[\"\"].additionalProgress[1].width-v\n        aura_env.debuffed[a] = nil\n    end\nend]]\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n",
