		["Rejuv party frame 2"] = {
			["textFlags"] = "None",
			["stacksSize"] = 12,
			["iconSource"] = -1,
			["authorOptions"] = {
				{
					["type"] = "input",
					["useDesc"] = true,
					["width"] = 1,
					["key"] = "anchor",
					["desc"] = "Where to anchor the aura (eg TOPLEFT)",
					["default"] = "BOTTOMLEFT",
