			["actions"] = {
				["start"] = {
				},
				["init"] = {
					["custom"] = "aura_env.scoreC = \"\"\n\naura_env.GetTR = function(level)\n    local tr\n    if level == 0 then\n        tr = 0\n    elseif level <= 9 then\n        tr = 220+((level-2)*90)\n    elseif level <= 20 then\n        tr = 1700+((level-10)*90) \n    elseif level <= 24 then\n        tr = 2600+((level-20)*65) \n    else\n        tr = 2860+((level-24)*55)     \n    end\n    return tr\nend\n\naura_env.GetAP = function(level)\n    local ap\n    if level == 0 then\n        ap = 0\n    elseif level <= 11 then\n        ap = 3000+((level-2)*75)\n    else\n        ap = 3000+((level-1)*75)\n    end\n    return ap\nend\n\naura_env.GetBaseScore = function(level)\n    local score\n    if level <= 10 then\n        score = level * 10\n    else\n        score = 1.1^(level-10)*100\n    end\n    return score\nend\n\naura_env.GetScoreColor = function(score)\n    if (IsAddOnLoaded(\"RaiderIO\")) then\n        local zone = C_ChallengeMode.GetMapTable()\n        local rR, rG, rB = RaiderIO.GetScoreColor(score*#zone)\n        aura_env.scoreC = string.format(\"|cff%.2X%.2X%.2X\", rR*255, rG*255, rB*255)\n    else\n        aura_env.scoreC = \"\"\n    end\n    return aura_env.scoreC\nend\n\naura_env.reward = {\n    Mplus = {\n        [0] = \"None\",\n        [2] = 200,\n        [3] = 203,\n        [4] = 207,\n        [5] = 210,\n        [6] = 210,\n        [7] = 213,\n        [8] = 216,\n        [9] = 216,\n        [10] = 220,\n        [11] = 220,\n        [12] = 223,\n        [13] = 223,\n        [14] = 226,\n    },\n    Raid = {\n        [14] = 200,\n        [15] = 213,\n        [16] = 226,\n    },\n    PvP = {\n        [0] = 200,\n        [1] = 207,\n        [2] = 213,\n        [3] = 220,\n        [4] = 226,\n    }\n}\n\n\n\n\n\n\n",
					["do_custom"] = true,
				},
				["finish"] = {
				},
			},
			["triggers"] = {
				{
					["trigger"] = {
						["type"] = "custom",
						["subeventSuffix"] = "_CAST_START",
						["custom_hide"] = "custom",
						["subeventPrefix"] = "SPELL",
						["event"] = "Health",
						["unit"] = "player",
						["custom"] = "function(e, nilc)\n    local a = aura_env\n    local c = \"|cffffc215\"\n    local info = C_MythicPlus.GetRunHistory(false,true)\n    local keyReward\n    \n    a.level = {}\n    for l = 1, #info do\n        local levelMax = info[l].level\n        tinsert(a.level, levelMax)\n    end\n    if a.level[1] == nil then\n        a.level = {0}\n    end\n    \n    table.sort(a.level, function(a,b) return b<a end)\n    keyReward = a.level[1]-1\n    \n    a.level[1] = a.GetScoreColor(a.GetBaseScore(a.level[1]))..a.level[1]\n    \n    local vault = C_WeeklyRewards.GetActivities()\n    local RrLvl = {}\n    local PrLvl = {false,false,false}\n    local pRank = {}\n    \n    for _, v in ipairs(vault) do\n        for i = 1, 3 do\n            if v.index == i then\n                if v.type == 3 then\n                    if v.level <= 0 then v.level = nil end\n                    tinsert(RrLvl, a.reward.Raid[v.level])\n                end\n                if v.type == 2 then\n                    if v.progress >= v.threshold then\n                        PrLvl[i] = true\n                    end\n                    if PrLvl[i] == true then\n                        tinsert(pRank, v.level)\n                    end\n                end\n            end\n        end\n    end\n    \n    for n = 1, 3 do\n        if PrLvl[n] == true then\n            pRank[n] = a.reward.PvP[pRank[n]]\n        end\n    end\n    \n    if pRank[1] == nil then pRank[1] = \"None\" end\n    if RrLvl[1] == nil then RrLvl[1] = \"None\" end\n    a.weekly = {}\n    a.MrLvl = {}\n    \n    for i = 1, #info do\n        local levelW = info[i].level\n        if levelW >= 14 then\n            levelW = 14\n        end\n        tinsert(a.weekly, a.reward.Mplus[levelW])\n    end\n    if #info == 0 then\n        a.MrLvl[1] = a.reward.Mplus[0]\n    else\n        table.sort(a.weekly, function(a,b) return b<a end)\n        tinsert(a.MrLvl, a.weekly[1])\n        tinsert(a.MrLvl, a.weekly[4])\n        tinsert(a.MrLvl, a.weekly[10])\n    end\n    \n    a.chest = c..\"Key Reward:|r\\n\"..keyReward..\"\\n\"\n    ..\"\\n\\n\"..c..\"Vault Raid:|r\\n\"..table.concat(RrLvl, \" | \")\n    ..\"\\n\\n\"..c..\"Vault M+:|r\\n\"..table.concat(a.MrLvl, \" | \")\n    ..\"\\n\\n\"..c..\"Vault PvP:|r\\n\"..table.concat(pRank, \" | \")\n    \n    return e == \"BETTER_MYTHIC_PLUS\" and nilc\nend\n\n\n",
