			["url"] = "https://wago.io/lKD0AGm2k/18",
			["actions"] = {
				["start"] = {
				},
				["finish"] = {
					["do_custom"] = false,
					["do_message"] = false,
					["custom"] = "",
				},
				["init"] = {
					["custom"] = "aura_env.icons = {\n    [1] = \"Interface\\\\TargetingFrame\\\\UI-RaidTargetingIcon_1\",\n    [2] = \"Interface\\\\TargetingFrame\\\\UI-RaidTargetingIcon_2\",\n    [3] = \"Interface\\\\TargetingFrame\\\\UI-RaidTargetingIcon_3\",\n    [4] = \"Interface\\\\TargetingFrame\\\\UI-RaidTargetingIcon_4\",\n    [5] = \"Interface\\\\TargetingFrame\\\\UI-RaidTargetingIcon_5\",\n    [6] = \"Interface\\\\TargetingFrame\\\\UI-RaidTargetingIcon_6\",\n    [7] = \"Interface\\\\TargetingFrame\\\\UI-RaidTargetingIcon_7\",\n    [8] = \"Interface\\\\TargetingFrame\\\\UI-RaidTargetingIcon_8\",\n}\n\nlocal aura_env = aura_env\n\naura_env.sortAndOffset = function()\n    local spacing = 2\n    local count = 0\n    local burst = 1\n    local t = {}\n    \n    for k, v in pairs(WeakAuras.clones[aura_env.id]) do\n        if v.state and v.state.index and v.state.show then\n            table.insert(t, v)\n        end\n    end\n    table.sort(t, function(a,b) return a.state.index < b.state.index end)\n    \n    for i, region in pairs(t) do\n        if region.toShow then\n            local xOffset = 0\n            local yOffset = 0 \n            \n            if aura_env.config.burst and region.state.index == 3 then\n                yOffset = yOffset + (region.height + spacing) * burst\n                burst = burst + 1\n            else\n                yOffset = yOffset - (region.height + spacing) * count\n                count = count + 1\n            end\n            \n            region:SetAnchor(\"CENTER\" , WeakAuras.regions[aura_env.id].region, \"CENTER\")\n            region:SetOffset(xOffset, yOffset)\n        end\n    end\nend",
					["do_custom"] = true,
				},
			},
			["triggers"] = {
				{
					["trigger"] = {
						["type"] = "custom",
						["subeventSuffix"] = "_CAST_START",
						["debuffType"] = "HELPFUL",
						["event"] = "Health",
						["unit"] = "player",
						["custom_type"] = "stateupdate",
						["spellIds"] = {
						},
						["events"] = "CLEU:SPELL_AURA_APPLIED:SPELL_AURA_APPLIED_DOSE:SPELL_AURA_REFRESH:SPELL_AURA_REMOVED:UNIT_DIED ENCOUNTER_START RAID_TARGET_UPDATE",
						["names"] = {
						},
						["check"] = "event",
						["custom"] = "function(states, event, ...)\n    if event == \"RAID_TARGET_UPDATE\" then\n        for k, v in pairs(states) do\n            if v.unit then\n                local mark = GetRaidTargetIndex(v.unit)\n                if mark and aura_env.icons[mark] then\n                    v.icon = aura_env.icons[mark]\n                    v.changed = true\n                    v.show = true\n                end\n            end\n        end\n    end\n    if event == \"ENCOUNTER_START\" and ... then\n        for k, v in pairs(states) do\n            aura_env.last = false\n            v.show = false\n            v.changed = true\n        end\n    end\n    \n    if event == \"COMBAT_LOG_EVENT_UNFILTERED\" and ... then\n        local _, message, _, srcGUID, srcName, _, _, destGUID, destName, _, destRaidFlags, spellid, _, _, _, amount = ...\n        if (message == \"SPELL_AURA_APPLIED\" or message == \"SPELL_AURA_REFRESH\" or message == \"SPELL_AURA_APPLIED_DOSE\") then\n            if spellid == 302999 then --Ignore\n                local theTime = GetTime()\n                if not states[1] then\n                    aura_env.last = theTime\n                    states[1] = {\n                        name = \"NEXT STACK\",\n                        icon = 236221,\n                        duration = 2.9,\n                        expirationTime = theTime + 2.9,\n                        index = 1,\n                        progressType = \"timed\",\n                        autoHide = true,\n                        show = true,\n                        changed = true,\n                    }\n                    aura_env.flag = true\n                end\n                \n                if WeakAuras.myGUID == destGUID then --Ignore\n                    states[2] = {\n                        name = \">YOUR<\",\n                        icon = 236221,\n                        stacks = amount or 0,\n                        duration = 5,\n                        expirationTime = theTime + 5,\n                        index = 2,\n                        progressType = \"timed\",\n                        autoHide = true,\n                        show = true,\n                        changed = true,\n                    }\n                    aura_env.flag = true\n                end\n            elseif spellid == 347350 and aura_env.config.burst then --Dancing Fever\n                local i = UnitInRaid(destName)\n                local unit\n                if i then\n                    unit = \"raid\"..i\n                end\n                states[destGUID] = {\n                    name = WA_ClassColorName(destName),\n                    unit = unit,\n                    icon = 460687,\n                    duration = 30,\n                    expirationTime = GetTime() + 30,\n                    index = 4,\n                    progressType = \"timed\",\n                    autoHide = true,\n                    show = true,\n                    changed = true,\n                }\n                aura_env.flag = true\n            end\n        elseif message == \"SPELL_AURA_REMOVED\" then\n            if spellid == 302999 and destGUID == WeakAuras.myGUID then --Ignore\n                local state = states[2]\n                if state then\n                    state.show = false\n                    state.changed = true\n                    \n                    aura_env.flag = true\n                end\n            elseif spellid == 347350 and aura_env.config.burst then --Dacning Fever\n                local state = states[destGUID]\n                if state then\n                    state.show = false\n                    state.changed = true\n                    \n                    aura_env.flag = true\n                end\n            end\n        elseif message == \"UNIT_DIED\" then\n            if destGUID == WeakAuras.myGUID then --Ignore\n                local state = states[2]\n                if state then\n                    state.