					["custom"] = "aura_env.partner = false\nfor unit in WA_IterateGroupMembers() do\n    if WA_GetUnitDebuff(unit, aura_env.spell) then\n        if WA_GetUnitDebuff(unit, aura_env.spell1) then\n            aura_env.partner = select(7, WA_GetUnitDebuff(unit, aura_env.spell1))\n            break\n        end\n    end\nend\n\n\n\nif aura_env.partner then\n    local frame = aura_env.GetFrame(aura_env.partner)\n    if frame then\n        aura_env.Glow(frame, true)\n    end\nend",
