						["events"] = "PLAYER_ENTERING_WORLD FRAME_UPDATE UNIT_POWER_UPDATE UNIT_SPELLCAST_INTERRUPTED UNIT_SPELLCAST_START UNIT_SPELLCAST_STOP UNIT_SPELLCAST_SUCCEEDED COMBAT_LOG_EVENT_UNFILTERED PLAYER_TALENT_UPDATE",
						["customDuration"] = "function()\n    return aura_env.asp[1], aura_env.asp[2], true\nend\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n",
						["custom"] = "function(event, ...)\n    local aura_env = aura_env\n    if event == \"UNIT_POWER_UPDATE\" or event == \"UNIT_POWER_FREQUENT\" or event == \"PLAYER_ENTERING_WORLD\" then    \n        aura_env.asp = {UnitPower(\"player\", Enum.PowerType.LunarPower), UnitPowerMax(\"player\", Enum.PowerType.LunarPower)};        \n    end\n    \n    if event == \"UNIT_POWER_UPDATE\" then -- power update events    \n        -- Cutaway/Fade animation\n        if aura_env.showSpendAnimation then\n            aura_env.power = aura_env.power or {};\n            aura_env.power[1] = aura_env.power[2] or aura_env.asp[1];\n            aura_env.power[2] = aura_env.asp[1];\n            \n            local difference = aura_env.power[2] - aura_env.power[1];\n            if difference < -20 then -- -20 because of normal decay\n                aura_env.cut = 0; -- \"progress\" variable for animation (will tick up with each frame)\n                local max = aura_env.asp[2];\n                local spentOverMax = (difference * -1) / max;\n                local barW = aura_env.this:GetWidth();   \n                local newW =  spentOverMax * barW;\n                aura_env.cutaway:SetWidth(newW);\n            end\n        end\n    elseif event == \"FRAME_UPDATE\" then -- every frame (for animation)\n        local time = GetTime();\n        aura_env.time = aura_env.time or {time, time};\n        aura_env.time[1] = aura_env.time[2] or time;\n        aura_env.time[2] = GetTime();\n        -- Cutaway/Fade animation\n        if aura_env.showSpendAnimation and aura_env.cut then\n            local elapsed = aura_env.time[2] - aura_env.time[1];            \n            aura_env.cut = aura_env.cut + (elapsed / aura_env.cutawayTimer);\n            if aura_env.cut >= 1 then\n                aura_env.cutaway:SetAlpha(1);  \n                aura_env.cutaway:Hide();   \n                aura_env.cut = nil;\n                if aura_env.showCutaway then \n                    aura_env.cutaway:SetPoint(\"LEFT\",aura_env.this.bar.fg,\"RIGHT\")\n                end\n            else\n                aura_env.cutaway:SetAlpha(1 - aura_env.cut);\n                aura_env.cutaway:Show();    \n                if aura_env.showCutaway then\n                    local off = aura_env.cut * aura_env.cutawayOffset;\n                    aura_env.cutaway:SetPoint(\"LEFT\",aura_env.this.bar.fg,\"RIGHT\", 0, -off)\n                end\n            end                  \n        end\n        \n        -- casting spark\n        if aura_env.inc then\n            if aura_env.castInfo then\n                local casting = GetTime() - aura_env.castInfo[2];            \n                local percent = casting / aura_env.castInfo[1];         \n                local castProgress = aura_env.castInfo[3] * percent;\n                aura_env.predictCastBar:SetPoint(\"LEFT\",aura_env.this.bar.fg, \"RIGHT\", castProgress, 0.2)\n                aura_env.predictCastBar:Show();\n            end\n        end\n    elseif event == \"PLAYER_TALENT_UPDATE\" then\n        local sotf = select(4, GetTalentInfo(5,1,1));\n        aura_env.generators[190984] = sotf and 9 or 6;\n    else -- spell cast events\n        local unit, cast, spell = ...; -- EVENT PARAMETERS FOR UNIT_SPELLCAST_START/ETC\n        \n        if event == \"UNIT_SPELLCAST_START\" and aura_env.generators[spell] and unit == \"player\" then -- cast started            \n            local LD = WA_GetUnitBuff('player', 298357) and 2 or 1; -- lucid dreams doubles ap gen while active, add a simple multiplier\n            aura_env.inc = aura_env.generators[spell] * LD;\n            aura_env.spell = spell;\n            \n            local startTime, endTime = select(4, UnitCastingInfo\"player\");      \n            startTime = startTime / 1000;\n            endTime = endTime / 1000;\n            \n            local duration = endTime - startTime\n            local totalWidth = aura_env.inc / aura_env.powerPerPixel;             \n            aura_env.castInfo = \n            {\n                duration,\n                startTime,\n                totalWidth\n            };            \n            \n        elseif event:find(\"UNIT_SPELLCAST\") and unit == \"player\" and aura_env.generators[spell] then\n            -- cast done/failed\n            aura_env.inc = nil; -- throw it out\n            aura_env.spell = nil;\n            aura_env.predictCastBar:Hide();\n            aura_env.castInfo = nil;\n        else\n            local _, type, _, source, _, _, _, dest, _, _, _, spell = ...; -- EVENT PARAMETERS FOR COMBAT_LOG_EVENT_UNFILTERED\n            if type == \"SPELL_AURA_REMOVED\" and dest == WeakAuras.myGUID and spell == 298357 and UnitCastingInfo\"player\" then\n                aura_env.inc = aura_env.generators[aura_env.spell];\n                \n                local startTime, endTime = select(4, UnitCastingInfo\"player\");      \n                startTime = startTime / 1000;\n                endTime = endTime / 1000;\n                \n                local duration = endTime - startTime\n                local totalWidth = aura_env.inc / aura_env.powerPerPixel;             \n                aura_env.castInfo = \n                {\n                    duration,\n                    startTime,\n                    totalWidth\n                };\n            end\n        end\n    end\n    aura_env.updatePowerText();\n    return true\nend",
